    "  \n",
    "  # Compile image\n",
    "  img = tf.image.decode_image(img)\n",
    "\n",
    "  # Resize image\n",
    "  img = tf.image.resize(img, [size, size])\n",
    "\n",
    "  # Scale the tensor\n",
    "  img = img / 255\n",
    "\n",
    "  return img\n",
